    .title--weight-bold { font-weight: 700; }
    .title--subtitle { 
        padding-bottom: 40px; 
        font-family: 'Open Sans', Arial ,sans-serif; 
        text-align: center;
    }
    .error h1,
    .error p { color: #226d7a; }
    .error--bg__cover {
        position: absolute;
        left: 0;
        right: 0;
        width: 90%;
        margin: 0 auto;
    }
    .error--shape__clouds svg {
        display: block;
    }
    .abstract-half-dot--circle {
        z-index: 0;
        position: absolute;
        left: 15em;
        right: 0;
        width: 300px;
        height: 300px;
        margin: 0 auto;
    }
    .icon-graphic {
        z-index: 1;
        position: relative;
        width: 300px;
        height: 300px;
        margin: 0 auto;
    }
    @media screen and (max-width: 767px) {
        .error--bg__cover { display: none; }
        .abstract-half-dot--circle { left: 0; }
    }
